import React from "react";

function NavBar({ handleLoginClick }) {
  const handleClick = () => {
    handleLoginClick();
  };
  return (
    <div className="navbar">

      <div>
        <span onClick={handleClick} className="loginicon">
          Sign In
        </span>
      </div>

      <div className="navlinks">
        <span onClick={handleClick} className= "">
          About
        </span>
    </div>

    </div>
  );
}

export default NavBar;
